import React from 'react';
import styled from 'styled-components';

const StyledContainer = styled.div`
  display: flex;
  padding: 20px 20%;
`;

const Container = () => {
  return (
    <StyledContainer>
      <Text color="red"></Text>
    </StyledContainer>
  );
}

export default Container;
